  // }
  console.log("hi bruce")
  return (
    <Router>
      <Switch>
        <Route path='/' exact component={Home} />
        <Route path='/signup' exact component={Signup} />
        <Route path='/dashboard' exact component={Dashbaord} />
      </Switch>
    </Router>
  );
}

export default App;
